const filtersDefaultState = {
  season: [],
  selectedSeason: [],
  hierarchy1: [],
  selectedHierarchy1: [],
  hierarchy2: [],
  selectedHierarchy2: [],
  hierarchy3: [],
  selectedHierarchy3: [],
  hierarchy4: [],
  selectedHierarchy4: [],
  hierarchy5: [],
  selectedHierarchy5: [],
  hierarchy6: [],
  selectedHierarchy6: [],
  hierarchy7: [],
  selectedHierarchy7: [],
  selectedDateRange: [],
};

export default (state = filtersDefaultState, action) => {
  switch (action.type) {
    case "SET_SEASON":
      return {
        ...state,
        season: action.payload,
      };
    case "SET_HIERARCHY1":
      return {
        ...state,
        hierarchy1: action.payload,
      };
    case "SET_HIERARCHY2":
      return {
        ...state,
        hierarchy2: action.payload,
      };
    case "SET_HIERARCHY3":
      return {
        ...state,
        hierarchy3: action.payload,
      };
    case "SET_HIERARCHY4":
      return {
        ...state,
        hierarchy4: action.payload,
      };
    case "SET_HIERARCHY5":
      return {
        ...state,
        hierarchy5: action.payload,
      };
    case "SET_HIERARCHY6":
      return {
        ...state,
        hierarchy6: action.payload,
      };

    case "SET_HIERARCHY7":
      return {
        ...state,
        hierarchy7: action.payload,
      };

    default:
      return state;
  }
};
